#wrap {
    background-color:aqua;
    width:440px; height:956px;
    padding-left:15px;
    padding-right:15px;
}
#wrap h1 {
    padding-top:120px;
    margin-bottom:30px;
    font-size:2.5rem;/* 40px */
    font-weight:700;/* bold */
}
#wrap > p {}/* #wrap ëª¨ë“  ìì‹ p */
